create database pruebasol;

use pruebasol;
SELECT `empleado`.`Id`,
    `empleado`.`Empresa`,
    `empleado`.`KeyEmpleado`,
    `empleado`.`IdEmpleado`,
    `empleado`.`Nombre`,
    `empleado`.`Primer_Apellido`,
    `empleado`.`Segundo_Apellido`,
    `empleado`.`Identificacion`
    
FROM `pruebasol`.empleado where empleado.departamento = 1 and activo =1 order by empleado.puesto asc;
select *from puestos

CREATE TABLE IF NOT EXISTS `departamentos` (
  `Id_Departamento` smallint(6) NOT NULL,
  `Descripcion` varchar(50) DEFAULT NULL,
  `Observaciones` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`Id_Departamento`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
select *from departamentos
    
CREATE TABLE IF NOT EXISTS `puestos` (
  `Id_Puesto` smallint(6) NOT NULL,
  `Id_Departamento` smallint(6) NOT NULL,
  `Descripcion` varchar(50) DEFAULT NULL,
  `Departamento` varchar(50) DEFAULT NULL,
  `Observaciones` varchar(500) DEFAULT NULL,
  PRIMARY KEY (`Id_Puesto`),
  KEY `Id_Departamento` (`Id_Departamento`),
  CONSTRAINT `FK_puestos_departamentos` FOREIGN KEY (`Id_Departamento`) REFERENCES `departamentos` (`Id_Departamento`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
    select *from puestos
    
    CREATE TABLE IF NOT EXISTS `empleado` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `Empresa` int(11) NOT NULL DEFAULT '1',
  `KeyEmpleado` varchar(50) COLLATE latin1_spanish_ci NOT NULL DEFAULT '',
  `IdEmpleado` varchar(10) COLLATE latin1_spanish_ci NOT NULL DEFAULT '0',
  `Nombre` varchar(50) COLLATE latin1_spanish_ci NOT NULL DEFAULT '0',
  `Primer_Apellido` varchar(25) COLLATE latin1_spanish_ci NOT NULL DEFAULT '0',
  `Segundo_Apellido` varchar(25) COLLATE latin1_spanish_ci DEFAULT '0',
  `Identificacion` varchar(50) COLLATE latin1_spanish_ci DEFAULT NULL,
  `Pasaporte` varchar(30) COLLATE latin1_spanish_ci DEFAULT '0',
  `Pais` varchar(10) COLLATE latin1_spanish_ci DEFAULT '0',
  `Departamento` smallint(6) NOT NULL DEFAULT '0',
  `Puesto` smallint(6) NOT NULL DEFAULT '0',
  `Activo` tinyint(4) NOT NULL DEFAULT '0',
  `Sexo` varchar(1) COLLATE latin1_spanish_ci DEFAULT '0',
  `Tipo_Sangre` varchar(10) COLLATE latin1_spanish_ci DEFAULT '0',
  `Telefono1` varchar(50) COLLATE latin1_spanish_ci NOT NULL DEFAULT '0',
  `Telefono2` varchar(50) COLLATE latin1_spanish_ci DEFAULT NULL,
  `Direccion` varchar(256) COLLATE latin1_spanish_ci DEFAULT '0',
  `Fotografia` blob,
  `Observaciones` varchar(250) COLLATE latin1_spanish_ci DEFAULT '0',
  `Sin_Porcentaje` tinyint(4) DEFAULT '0',
  `FechaIngreso` date DEFAULT NULL,
  `FechaRefVac` date DEFAULT NULL,
  `FechaIngresoRH` datetime DEFAULT CURRENT_TIMESTAMP,
  `FechaVencimientoLicencia` date DEFAULT NULL,
  `FechaVencimientoVisa` date DEFAULT NULL,
  `VacacionesPen` int(11) DEFAULT NULL,
  `VacacionesPeriodoActual` int(11) DEFAULT NULL,
  `VacacionesAcumuladas` int(11) DEFAULT NULL,
  `SalarioRef` double DEFAULT '0',
  `Jornada` int(11) DEFAULT NULL,
  `SalarioxHora` double DEFAULT NULL,
  `IdTarjeta` varchar(15) COLLATE latin1_spanish_ci DEFAULT NULL,
  `UltimaActualizacion` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`Id`),
  UNIQUE KEY `KeyEmpleado` (`KeyEmpleado`),
  UNIQUE KEY `IdTarjeta` (`IdTarjeta`),
  KEY `FK_empleado_departamentos` (`Departamento`),
  KEY `FK_empleado_puestos` (`Puesto`),
  CONSTRAINT `FK_empleado_departamentos` FOREIGN KEY (`Departamento`) REFERENCES `departamentos` (`Id_Departamento`),
  CONSTRAINT `FK_empleado_puestos` FOREIGN KEY (`Puesto`) REFERENCES `puestos` (`Id_Puesto`)
) ENGINE=InnoDB AUTO_INCREMENT=23979 DEFAULT CHARSET=latin1 COLLATE=latin1_spanish_ci;
